import React from "react";
import { Link } from "react-router-dom";
import { TextField } from "@material-ui/core";

const Home = (data, onChange) => {
    return(

        <ul>
            <TextField name="username" id="username" value={data} label="Username" variant="outlined" fullWidth onChange={(e) => onChange(e)} required/>
            <Link to="/">Go back to Log In</Link>
        </ul>


    )
}

export default Home;
